import React from 'react';
import GalleryData from './GalleryData';


function NFT_Page(){
    return(
        <>
            {GalleryData.map(function(images){
                return(
                    <div>
                    {images.imageName}
                    </div>
                )
            })}
        </>
    )
}

export default NFT_Page;
